Let's start with this simple Resource: { "@id": "https://example.com/john", "https://example.com/lastName": "McLovin",
} Then the following Path targets the McLovin value: https://example.com/john https://example.com/lastname => McLovin If the resource is an instance of a Class (an atomic:isA property), you can use the Shortnames of the Properties that are referred to by that class. Since John is an instance of a Person, he might have a lastname which maps to https://example.com/latname. https://example.com/john lastname => McLovin We can also traverse relationships: [{ "@id": "https://example.com/john", "https://example.com/lastName": "McLovin", "https://example.com/employer": "https://example.com/XCorp",
},{ "@id": "https://example.com/XCorp", "https://example.com/description": "The greatest company!",
}] https://example.com/john employer description => The greatest company! In the example above, the XCorp subject exists and is the source of the The greatest company! value. However, using paths, it's also possible to created nested resources without creating new URLs for all children .

