All Atomic Data Resources that we've discussed so far have a URL as a subject. Unfortunately, creating unique and resolvable URLs can be a bother, and sometimes not necessary. If you've worked with RDF, this is what Blank Nodes are used for. In Atomic Data, we have something similar: Nested Resources . Let's use a Nested Resource in the example from the previous section: { "@id": "https://example.com/john", "https://example.com/lastName": "McLovin", "https://example.com/employer": { "https://example.com/description": "The greatest company!", },
} By combining two Subject URLs into a single string, we've created a nested resource. The Subject of the nested resource is https://example.com/john https://example.com/employer, including the spacebar. Note that the path from before still resolves: https://example.com/john employer description => The greatest company! We can also navigate Arrays using paths For example: { "@id": "https://example.com/john", "hasShoes": [ { "https://example.com/name": "Mr. Boot", }, { "https://example.com/name": "Sunny Sandals", } ]
} The Path of Mr. Boot is: https://example.com/john hasShoes 0 name You can target an item in an array by using a number to indicate its position, starting with 0. Notice how the Resource with the name: Mr. Boot does not have an explicit @id, but it does have a Path. This means that we still have a unique, globally resolvable identifier - yay!

