For example, let's say I want to render someone's birthday: <example:joep> <schema:birthDate> "1991-01-20"^^xsd:date Rendering this item might be as simple as fetching the subject URL, filtering by predicate URL, and parsing the object as a date. However, this is also valid RDF: <example:joep> <schema:birthDate> "1991-01-20"^^xsd:date <example:someNamedGraph>
<example:joep> <schema:birthDate> <example:birthDateObject> <example:someOtherNamedGraph>
<example:joep> <schema:birthDate> "20th of januari 1991"@en <example:someNamedGraph>
<example:joep> <schema:birthDate> "20 januari 1991"@nl <example:someNamedGraph>
<example:joep> <schema:birthDate> "2000-02-30"^^xsd:date <example:someNamedGraph> Now things get more complicated if you just want to select the original birthdate value: Select the named graph . The triple containing that birthday may exist in some named graph different from the subject URL, which means that I first need to identify and fetch that graph. Select the subject . Select the predicate . Select the datatype . You probably need a specific datatype (in this case, a Date), so you need to filter the triples to match that specific datatype. Select the language . Same could be true for language, too, but that is not necessary in this birthdate example. Select the specific triple . Even after all our previous selectors, we still might have multiple values. How do I know which is the triple I'm supposed to use? To be fair, with a lot of RDF data, only steps 2 and 3 are needed, since there are often no subject-predicate collisions. And if you control the data of the source, you can set any constraints that you like, inlcluding subject-predicate uniqueness. But if you're building a system that uses arbitrary RDF, that system also needs to deal with steps 1,4,5 and 6. That often means writing a lot of conditionals and other client-side logic to get the value that you need. It also means that serializing to a format like JSON becomes complicated - you can't just map predicates to keys - you might get collisions. And you can't use key-value stores for storing RDF, at least not in a trivial way. Every single selected value should be treated as an array of unknown datatypes, and that makes it really difficult to build software. All this complexity is the direct result of the lack of subject-predicate uniqueness. As a developer who uses RDF data, I want to be able to do something like this: // Fetches the resource
const joep = get("https://example.com/person/joep")
// Returns the value of the birthDate atom
console.log(joep.birthDate()) // => Date(1991-01-20)
// Fetches the employer relation at possibly some other domain, checks that resource for a property with the 'name' shortkey
console.log(joep.employer().name()) // => "Ontola.io" Basically, I'd like to use all knowledge of the world as if it were a big JSON object. Being able to do that, requires using some things that are present in JSON, and using some things that are present in RDF. Traverse data on various domains (which is already possible with RDF) Have unique subject-predicate combinations (which is default in JSON) Map properties URLs to keys (which often requires local mapping with RDF, e.g. in JSON-LD) Link properties to datatypes (which is possible with ontologies like SHACL / SHEX)

