Atomic Data requires a bit more information about pieces of data than JSON tends to contain. Let's take a look at a regular JSON example: { "name": "John", "birthDate": "1991-01-20"
} We need more information to convert this JSON into Atomic Data. The following things are missing: What is the Subject URL of the resource being described? What is the Predicate URL of the keys being used? (name and birthDate), and consequentially, how should the values be parsed? What are their DataTypes? We can add this data by adding some @context : { "@id": "https://example.com/people/john", "https://example.com/properties/name": "John", "https://example.com/properties/birthDate": "1991-01-20"
}

