Atomic Data is a strict subset of RDF, and the most popular serialization of RDF for JSON data is JSON-LD . All JSON-LD is perfectly valid JSON, but with a couple of handy features. Since Atomic Schema requires the presence of a key slug in Properties, converting Atomic Data to JSON results in dev-friendly objects with nice shorthands. { "@id": "https://example.com/people/John", "https://example.com/properties/lastname": "John", "https://example.com/properties/bestFriend": "https://example.com/sarah",
} Can be automatically converted to: { "@context": { "@id": "https://example.com/people/John", "name": "https://example.com/properties/lastname", "bestFriend": "https://example.com/properties/bestFriend", }, "name": "John", "bestFriend": { "@id": "https://example.com/sarah" },
} The @context object provides a mapping to the original URLs.
